import React from 'react';
import { Navigate } from 'react-router-dom';

const ProtectedRoute = ({ element: Element, isAuthenticated, ...rest }) => {
    if (!isAuthenticated) {
        return <Navigate to="/login" replace />;
    }

    return <Element {...rest} />;
};

export default ProtectedRoute;
